import base64
import os
import sys




def generate_base64(file):
    with open(file, "rb") as f:
        base64_data = base64.b64encode(f.read())
        print(base64_data)


res_map = {"welcome.jpg": b'',
           "task.ico": b'',
           "login.ico": b''
           }

def get_res(name):
    if name in res_map:
        img_data = base64.b64decode(res_map[name])

        # 获取不同平台的 temp 目录
        if sys.platform == "win32":
            temp_path = os.environ["Temp"]
        else:
            return
        pic_path = os.path.join(os.path.dirname(os.path.realpath(temp_path)).replace('\\', '/'), name)
        with open(pic_path, 'wb') as f:
            f.write(img_data)
        return pic_path




